pub trait AsyncTemperatureSensor: Send { type Error: std::fmt::Debug + Send; async fn read_temperature(&mut self) -> Result<Temperature, Self::Error>; fn sensor_id(&self) -> &str;
} // Commands the monitor can handle
pub enum MonitorCommand { SetInterval(Duration), GetStats(oneshot::Sender<Option<TemperatureStats>>), GetLatest(oneshot::Sender<Option<TemperatureReading>>), Stop,
} // The main async monitor
pub struct AsyncTemperatureMonitor { store: TemperatureStore, command_rx: mpsc::Receiver<MonitorCommand>,
} impl AsyncTemperatureMonitor { pub async fn run<S: AsyncTemperatureSensor>(&mut self, mut sensor: S, initial_interval: Duration) { let mut sample_interval = interval(initial_interval); loop { tokio::select! { // Sample temperature at regular intervals _ = sample_interval.tick() => { match sensor.read_temperature().await { Ok(temp) => { let reading = TemperatureReading::new(temp); self.store.add_reading(reading); println!("📊 {}", temp); } Err(e) => { eprintln!("❌ Sensor error: {:?}", e); } } } // Handle control commands command = self.command_rx.recv() => { match command { Some(MonitorCommand::SetInterval(new_interval)) => { sample_interval = interval(new_interval); } Some(MonitorCommand::GetStats(reply)) => { let stats = self.store.calculate_stats(); let _ = reply.send(stats); } Some(MonitorCommand::Stop) => break, None => break, // Channel closed } } } } println!("🛑 Monitor stopped"); }
}

