use std::collections::HashMap; pub struct ProtocolHandler { next_message_id: u32, pending_requests: HashMap<u32, std::time::Instant>,
} impl ProtocolHandler { pub fn new() -> Self { Self { next_message_id: 1, pending_requests: HashMap::new(), } } pub fn create_command(&mut self, command: Command) -> ProtocolMessage { let id = self.next_message_id; self.next_message_id += 1; self.pending_requests.insert(id, std::time::Instant::now()); ProtocolMessage { version: 1, id, payload: MessagePayload::Command(command), } } pub fn create_response(&self, request_id: u32, response: Response) -> ProtocolMessage { ProtocolMessage { version: 1, id: request_id, payload: MessagePayload::Response(response), } } pub fn serialize_json(&self, message: &ProtocolMessage) -> Result<String, serde_json::Error> { serde_json::to_string(message) } pub fn serialize_binary(&self, message: &ProtocolMessage) -> Result<Vec<u8>, postcard::Error> { postcard::to_allocvec(message) } pub fn deserialize_json(&self, data: &str) -> Result<ProtocolMessage, serde_json::Error> { serde_json::from_str(data) } pub fn deserialize_binary(&self, data: &[u8]) -> Result<ProtocolMessage, postcard::Error> { postcard::from_bytes(data) } pub fn cleanup_expired_requests(&mut self, timeout_duration: std::time::Duration) { let now = std::time::Instant::now(); self.pending_requests.retain(|_, timestamp| { now.duration_since(*timestamp) < timeout_duration }); }
} // Usage example
fn protocol_usage_example() -> Result<(), Box<dyn std::error::Error>> { let mut handler = ProtocolHandler::new(); // Create a command let command = Command::GetReading { sensor_id: "temp_01".to_string(), }; let request_msg = handler.create_command(command); // Serialize for transmission let json_data = handler.serialize_json(&request_msg)?; let binary_data = handler.serialize_binary(&request_msg)?; println!("JSON message: {}", json_data); println!("Binary message size: {} bytes", binary_data.len()); // Deserialize received message let received_msg = handler.deserialize_json(&json_data)?; println!("Received message ID: {}", received_msg.id); // Create response let response = Response::Reading { sensor_id: "temp_01".to_string(), temperature: 23.5, timestamp: 1672531200, }; let response_msg = handler.create_response(received_msg.id, response); println!("Response: {:?}", response_msg); Ok(())
}

