} // Ring buffer with compile-time size validation
struct RingBuffer<T, const N: usize> { buffer: [Option<T>; N], head: usize, tail: usize, full: bool,
} impl<T, const N: usize> RingBuffer<T, N> { const fn new() -> Self { // Compile-time assertion assert!(N > 0 && (N & (N - 1)) == 0, "Buffer size must be power of two"); const fn none<T>() -> Option<T> { None } RingBuffer { buffer: [none(); N], head: 0, tail: 0, full: false, } } const fn capacity(&self) -> usize { N } const fn mask(&self) -> usize { N - 1 // Works because N is power of 2 } fn push(&mut self, item: T) -> Result<(), T> { if self.full { return Err(item); } self.buffer[self.head] = Some(item); self.head = (self.head + 1) & self.mask(); self.full = self.head == self.tail; Ok(()) } fn pop(&mut self) -> Option<T> { if self.is_empty() { return None; } let item = self.buffer[self.tail].take()?; self.tail = (self.tail + 1) & self.mask(); self.full = false; Some(item) } const fn is_empty(&self) -> bool { !self.full && self.head == self.tail }
} // Usage with compile-time validated size
