#[derive(Clone, Copy, Debug, PartialEq)]
enum MonitorState { Initializing, Idle, Reading, Processing, Transmitting, Error(ErrorCode),
} #[derive(Clone, Copy, Debug, PartialEq)]
enum ErrorCode { SensorTimeout, InvalidReading, CommunicationError, OverTemperature,
} #[derive(Clone, Copy, Debug)]
enum MonitorEvent { InitComplete, StartReading, ReadingComplete(f32), ReadingFailed(ErrorCode), ProcessingComplete, TransmissionComplete, TransmissionFailed, ErrorRecovered,
} struct TemperatureMonitor { state: MonitorState, reading_count: u32, error_count: u32, last_reading: Option<f32>,
} impl TemperatureMonitor { const fn new() -> Self { Self { state: MonitorState::Initializing, reading_count: 0, error_count: 0, last_reading: None, } } fn handle_event(&mut self, event: MonitorEvent) -> MonitorState { self.state = match (self.state, event) { (MonitorState::Initializing, MonitorEvent::InitComplete) => { MonitorState::Idle } (MonitorState::Idle, MonitorEvent::StartReading) => { self.start_sensor_reading(); MonitorState::Reading } (MonitorState::Reading, MonitorEvent::ReadingComplete(temp)) => { self.last_reading = Some(temp); self.reading_count += 1; MonitorState::Processing } (MonitorState::Reading, MonitorEvent::ReadingFailed(error)) => { self.error_count += 1; MonitorState::Error(error) } (MonitorState::Processing, MonitorEvent::ProcessingComplete) => { if self.should_transmit() { MonitorState::Transmitting } else { MonitorState::Idle } } (MonitorState::Transmitting, MonitorEvent::TransmissionComplete) => { MonitorState::Idle } (MonitorState::Error(_), MonitorEvent::ErrorRecovered) => { MonitorState::Idle } // Invalid transitions maintain current state _ => self.state, }; self.state } fn start_sensor_reading(&self) { // Initiate ADC conversion or I2C transaction } fn should_transmit(&self) -> bool { // Transmit every 10 readings or if temperature is critical self.reading_count % 10 == 0 || self.last_reading.map_or(false, |t| t > 40.0) } fn get_status(&self) -> &'static str { match self.state { MonitorState::Initializing => "Initializing sensors...", MonitorState::Idle => "Ready", MonitorState::Reading => "Reading sensors...", MonitorState::Processing => "Processing data...", MonitorState::Transmitting => "Transmitting...", MonitorState::Error(ErrorCode::SensorTimeout) => "Sensor timeout", MonitorState::Error(ErrorCode::InvalidReading) => "Invalid reading", MonitorState::Error(ErrorCode::CommunicationError) => "Comm error", MonitorState::Error(ErrorCode::OverTemperature) => "CRITICAL: Over temp!", } }
} // Interrupt-safe shared data
use core::cell::RefCell;
use cortex_m::interrupt::{self, Mutex}; type SharedSensorData = Mutex<RefCell<Option<f32>>>;
static SENSOR_DATA: SharedSensorData = Mutex::new(RefCell::new(None)); fn read_shared_sensor_data() -> Option<f32> { interrupt::free(|cs| { *SENSOR_DATA.borrow(cs).borrow() })
} fn write_shared_sensor_data(value: f32) { interrupt::free(|cs| { *SENSOR_DATA.borrow(cs).borrow_mut() = Some(value); });
} // Task scheduler with fixed-size task array
struct Task { period_ms: u32, last_run: u32, enabled: bool, function: fn(),
} impl Task { const fn new(period_ms: u32, function: fn()) -> Self { Self { period_ms, last_run: 0, enabled: true, function, } } fn should_run(&self, current_time: u32) -> bool { self.enabled && current_time.wrapping_sub(self.last_run) >= self.period_ms } fn run(&mut self, current_time: u32) { (self.function)(); self.last_run = current_time; }
