#![no_std]
#![no_main] use esp_backtrace as _;
use esp_hal::{ clock::ClockControl, delay::Delay, gpio::{Io, Level, Output}, peripherals::Peripherals, prelude::*, system::SystemControl,
};
use temp_embedded::{ EmbeddedTemperatureStore, EmbeddedProtocolHandler, EmbeddedCommand, EmbeddedResponse, EmbeddedTemperatureReading, Temperature, READING_BUFFER_SIZE
};
use serde_json_core; #[entry]
fn main() -> ! { // ESP32-C3 initialization let peripherals = Peripherals::take(); let system = SystemControl::new(peripherals.SYSTEM); let clocks = ClockControl::max(system.clock_control).freeze(); let delay = Delay::new(&clocks); // Initialize GPIO for status LED let io = Io::new(peripherals.GPIO, peripherals.IO_MUX); let mut led = Output::new(io.pins.gpio8, Level::Low); // Initialize our temperature monitoring components let mut store: EmbeddedTemperatureStore<READING_BUFFER_SIZE> = EmbeddedTemperatureStore::new(); let mut protocol_handler: EmbeddedProtocolHandler<READING_BUFFER_SIZE> = EmbeddedProtocolHandler::new(); // Initialize with boot time protocol_handler.init(get_boot_timestamp()); // System status esp_println::println!("🌡️ ESP32-C3 Temperature Monitor Starting"); esp_println::println!("📊 Buffer capacity: {} readings", store.capacity()); esp_println::println!("⚡ Sample rate: {} Hz", temp_embedded::SAMPLE_RATE_HZ); esp_println::println!("📋 JSON output format: STATUS_JSON, STATS_JSON, READING_JSON"); esp_println::println!("🔧 Send JSON commands: {{\"GetStatus\"}}, {{\"GetStats\"}}, {{\"GetLatestReading\"}}"); // Demonstrate serde JSON functionality esp_println::println!("=== SERDE DEMO: Processing sample commands ==="); demonstrate_json_commands(&mut protocol_handler, 0); esp_println::println!("=== Starting continuous monitoring ==="); let mut reading_count = 0u32; loop { // Flash LED to show we're alive led.set_high(); delay.delay_millis(50); led.set_low(); // Simulate reading from hardware sensor let adc_value = simulate_adc_reading(reading_count); let temperature = Temperature::from_embedded_sensor(adc_value); // Store the reading let timestamp = get_current_timestamp(); if let Err(e) = protocol_handler.add_reading(temperature, timestamp) { esp_println::println!("Storage error: {}", e); } else { reading_count += 1; if reading_count % 10 == 0 { // Process status command and output as JSON let status_command = EmbeddedCommand::GetStatus; let response = protocol_handler.process_command(status_command, timestamp); // Serialize status response to JSON using serde if let Ok(json_str) = serde_json_core::to_string::<_, 256>(&response) { esp_println::println!("STATUS_JSON: {}", json_str); } // Show latest statistics as JSON let stats_command = EmbeddedCommand::GetStats; let stats_response = protocol_handler.process_command(stats_command, timestamp); if let Ok(json_str) = serde_json_core::to_string::<_, 256>(&stats_response) { esp_println::println!("STATS_JSON: {}", json_str); } // Output current temperature reading as JSON let current_reading = EmbeddedTemperatureReading::new(temperature, timestamp); if let Ok(json_str) = serde_json_core::to_string::<_, 256>(&current_reading) { esp_println::println!("READING_JSON: {}", json_str); } } } // Wait according to sample rate (100ms for 10Hz) delay.delay_millis(100); }
} fn demonstrate_json_commands(protocol_handler: &mut EmbeddedProtocolHandler<READING_BUFFER_SIZE>, timestamp: u32) { esp_println::println!("📝 Demonstrating JSON command processing with serde:"); // Add some sample readings first let temp1 = Temperature::from_embedded_sensor(simulate_adc_reading(0)); let temp2 = Temperature::from_embedded_sensor(simulate_adc_reading(10)); let temp3 = Temperature::from_embedded_sensor(simulate_adc_reading(20)); let _ = protocol_handler.add_reading(temp1, timestamp); let _ = protocol_handler.add_reading(temp2, timestamp + 1); let _ = protocol_handler.add_reading(temp3, timestamp + 2); // Demonstrate various commands let commands = [ ("GetStatus", EmbeddedCommand::GetStatus), ("GetStats", EmbeddedCommand::GetStats), ("GetLatestReading", EmbeddedCommand::GetLatestReading), ("GetReadingCount", EmbeddedCommand::GetReadingCount) ]; for (cmd_name, command) in &commands { esp_println::println!("🔄 Processing command: {}", cmd_name); // Process the command let response = protocol_handler.process_command(command.clone(), timestamp + 10); // Serialize response to JSON using serde match serde_json_core::to_string::<_, 512>(&response) { Ok(json_response) => { esp_println::println!("✅ JSON Response: {}", json_response); } Err(_) => { esp_println::println!("❌ Failed to serialize response"); } } esp_println::println!(""); }
} fn simulate_adc_reading(count: u32) -> u16 { // Simulate temperature sensor ADC reading // Varies between ~20-30°C (ADC values ~800-1200 for our conversion) let base_temp = 25.0; let variation = (count as f32 * 0.1).sin() * 5.0; let temp_celsius = base_temp + variation; // Convert to 12-bit ADC value (assuming 10mV/°C sensor, 3.3V ref) let voltage = temp_celsius * 0.01; // 10mV/°C let adc_value = (voltage / 3.3) * 4095.0; adc_value as u16
} fn get_boot_timestamp() -> u32 { // In real implementation, this would be actual boot time 0
} fn get_current_timestamp() -> u32 { // In real implementation, this would use hardware timer // For simulation, we'll use a simple counter static mut COUNTER: u32 = 0; unsafe { COUNTER += 1; COUNTER }
}

