/// A dynamically-allocated array that maintains safety invariants
///
/// This safe wrapper ensures:
/// - Memory is properly allocated and deallocated
/// - All elements are properly initialized before access
/// - Bounds checking prevents out-of-bounds access
/// - Proper cleanup occurs even if panics happen
pub struct SafeArray<T> { ptr: *mut T, len: usize, capacity: usize,
} impl<T> SafeArray<T> { /// Creates a new SafeArray with the specified capacity pub fn with_capacity(capacity: usize) -> Self { if capacity == 0 { return SafeArray { ptr: std::ptr::NonNull::dangling().as_ptr(), len: 0, capacity: 0, }; } let ptr = unsafe { // SAFETY: capacity > 0 (checked above) // We store the capacity and will deallocate with same count allocate_array::<T>(capacity) }; SafeArray { ptr, len: 0, capacity, } } /// Pushes a new element to the end of the array /// /// This is safe because it: /// - Checks bounds before writing /// - Only writes to uninitialized memory (len..capacity) /// - Updates len after successful initialization pub fn push(&mut self, value: T) -> Result<(), T> { if self.len >= self.capacity { return Err(value); // Array is full } unsafe { // SAFETY: // - ptr is valid (allocated in constructor) // - len < capacity (checked above) // - Element at len is uninitialized (guaranteed by len invariant) initialize_element(self.ptr, self.len, value); } self.len += 1; Ok(()) } /// Gets a reference to an element at the given index /// /// This is safe because it: /// - Performs bounds checking /// - Only accesses initialized memory (0..len) /// - Returns a proper Rust reference with lifetime tied to self pub fn get(&self, index: usize) -> Option<&T> { if index < self.len { unsafe { // SAFETY: // - ptr is valid (allocated in constructor) // - index < len (checked above) // - Element is initialized (guaranteed by len invariant) Some(&*self.ptr.add(index)) } } else { None } } pub fn len(&self) -> usize { self.len }
}

