struct Rectangle { width: f64, height: f64,
} impl Rectangle { // Method that takes &self (immutable borrow) fn area(&self) -> f64 { self.width * self.height } // Method that takes &mut self (mutable borrow) fn scale(&mut self, factor: f64) { self.width *= factor; self.height *= factor; } // Method that takes self (takes ownership) fn into_square(self) -> Rectangle { let size = (self.width + self.height) / 2.0; Rectangle { width: size, height: size, } }
} // Usage
let mut rect = Rectangle { width: 10.0, height: 5.0 };
println!("Area: {}", rect.area()); // Borrows immutably
rect.scale(2.0); // Borrows mutably
let square = rect.into_square(); // Takes ownership
// rect is no longer usable here!

