let maybe_number: Option<i32> = Some(5); // Unwrapping (use carefully!)
let number = maybe_number.unwrap(); // Panics if None
let number = maybe_number.unwrap_or(0); // Default value
let number = maybe_number.unwrap_or_else(|| compute_default()); // Safe checking
if maybe_number.is_some() { println!("Has value: {}", maybe_number.unwrap());
} // Transformation
let doubled = maybe_number.map(|x| x * 2); // Some(10) or None
let as_string = maybe_number.map(|x| x.to_string()); // Filtering
let even = maybe_number.filter(|&x| x % 2 == 0);

